        e.preventDefault();
        props.onSubmit("Say hello!");
    }
    return(
        <form onSubmit={handleSubmit}>
            <div className="form-group">
                <div className="input-group">
                    <div className="circle"></div>
                    <div><input type="text" id="new-todo-input" name="text" autoComplete="off" placeholder="Create a new todo..." /> </div>
                </div>
            </div>
        </form>

    );
}
